    true,nt"url": null,nt"notes": "The TIGERweb application allows users to
    access and view geospatial features, geographic area information, and associated
    attributes from the U.S. Census Bureau Topologically Integrated Geographic Encoding
    and Referencing System (TIGER) geodatabase. The TIGERweb is intended to meet the
    needs of users inside and outside the Census Bureau for access to geospatial data
    contained within the TIGER geodatabase without requiring the use of a GIS. The TIGERweb
    map layers are grouped by the following geographies: Transportation (Roads and Railroads),
    Tribal Census Tracts and Block Groups, Census Tracts and Blocks, Military Installations,
    School Districts, Places and County Subdivisions, American Indian, Alaska Native,
    and Native Hawaiian Areas, Legislative Areas, Census Regions and Divisions, Urban
    Areas - Census 2000, Metropolitan and Micropolitan Statistical Areas and Related
    Statistical Areas, Hydrography, States and Counties. Labels are included for the
    map layers.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
